<p>\u4E3A\u4E86\u7F16\u5199\u53EF\u7EF4\u62A4\u7684\u4EE3\u7801\uFF0C\u6211\u4EEC\u628A\u5F88\u591A\u51FD\u6570\u5206\u7EC4\uFF0C\u5206\u522B\u653E\u5230\u4E0D\u540C\u7684\u6587\u4EF6\u91CC\uFF0C\u8FD9\u6837\uFF0C\u6BCF\u4E2A\u6587\u4EF6\u5305\u542B\u7684\u4EE3\u7801\u5C31\u76F8\u5BF9\u8F83\u5C11\uFF0C\u5F88\u591A\u7F16\u7A0B\u8BED\u8A00\u90FD\u91C7\u7528\u8FD9\u79CD\u7EC4\u7EC7\u4EE3\u7801\u7684\u65B9\u5F0F\u3002\u5728 Node.js \u73AF\u5883\u4E2D\uFF0C\u4E00\u4E2A <code v-pre>.js</code> \u6587\u4EF6\u5C31\u79F0\u4E4B\u4E3A\u4E00\u4E2A\u6A21\u5757(module)\u3002</p>
